ReactDom.render(<div>
    <header>
    <h1>Indian Cricket Player</h1>
    </header>
    <Card 
    name="Sachin"
    image="https://sportstar.thehindu.com/cricket/article31080794.ece/ALTERNATES/LANDSCAPE_1200/Sachin-Tendulkar"
